import React from 'react';
import logo from './logo.svg';
import './App.css';
import {observer} from 'mobx-react'

@observer
class App extends React.Components {
  render(){
  return (
    <div className="App">
      <h1>Todo List</h1>
    </div>
  );
}
}
export default App;
